import React, { Component } from "react";
import Wrapper from "./components/wrapper";
import Title from "./components/title";

class App extends Component {
  render() {
    return (
      <Wrapper>
        <Title> Clicky Game! Click an image to begin <strong></strong></Title>
      </Wrapper>
    );
  }
}
export default App;
